@patalmeida63 Yo soy alérgica a los antibióticos y a algunos medicamentos , pero me pusieron las dos dosis de Moderna y no tuve ningún síntoma.
Uno de mis hijos tuvo covid en Julio del 20 , y se vacuna el dia 7 . 
Tú habla con tu médico y el te indicará que hacer.

@covid_salamanca Bueno, llevamos casi 200 en dos días y hay 0 ingresos...
El Covid no es lo que era, es un hecho, la peligrosidad ha bajado mucho mucho, de hecho, solo hay que comparar hospital y muertes, de enero con ahora, o del año pasado...
No hay que crear alarmas, solo cuidarse un poco más

